// set_fields から値を取得
const inputData = $input.first().json;

// デバッグ
console.log('Full input data:', inputData);

const difyThisMonth  = inputData.dify_total_stars_lastMonthEnd;
const n8nThisMonth   = inputData.n8n_total_stars_lastMonthEnd;
const difyLastMonth  = inputData.dify_total_stars_twoMonthsAgoEnd;
const n8nLastMonth   = inputData.n8n_total_stars_twoMonthsAgoEnd;

const missing = [];
if (difyThisMonth === undefined)  missing.push('dify_total_stars_lastMonthEnd');
if (n8nThisMonth  === undefined)  missing.push('n8n_total_stars_lastMonthEnd');
if (difyLastMonth === undefined)  missing.push('dify_total_stars_twoMonthsAgoEnd');
if (n8nLastMonth  === undefined)  missing.push('n8n_total_stars_twoMonthsAgoEnd');
if (missing.length) {
  throw new Error(`Missing fields: ${missing.join(', ')}`);
}

// 差分計算
const difyDiff = difyThisMonth - difyLastMonth;
const n8nDiff  = n8nThisMonth  - n8nLastMonth;

// フォーマッタ
const formatNumber = n => (typeof n === 'number' && !isNaN(n)) ? n.toLocaleString() : '-';
const formatDiff   = d => d >= 0 ? `+${formatNumber(d)}` : formatNumber(d);

// 先月（タイトル用）
const today      = new Date();
const lastMonth  = new Date(today.getFullYear(), today.getMonth() - 1);
const titleDate  = `${String(lastMonth.getMonth() + 1).padStart(2, '0')}-${lastMonth.getFullYear()}`;
const docName    = `${titleDate}_github stars comparison`;
const docTitle   = docName;

// ------------ 重要: Create folder ノードからフォルダIDを取得 ------------
const folderData = $('Create folder').first().json;
const folderId = folderData.id;

console.log('Using folder ID from Create folder node:', folderId);

if (!folderId) {
  throw new Error('Folder ID not found from Create folder node');
}

// ------------ HTML 本文 ------------
const htmlDocument = `<!DOCTYPE html><html><head><meta charset="UTF-8"><style>
body{font-family:Arial,sans-serif;margin:20px;line-height:1.6;}
h1{color:#333;font-size:24px;margin-bottom:20px;border-bottom:2px solid #4285F4;padding-bottom:10px;}
h2{color:#4285F4;font-size:18px;margin-top:30px;margin-bottom:15px;}
table{border-collapse:collapse;width:100%;margin:20px 0;box-shadow:0 2px 4px rgba(0,0,0,.1);}
th,td{border:1px solid #ddd;padding:12px;text-align:center;}
th{background:#4285F4;color:#fff;font-weight:bold;}
td:first-child{font-weight:bold;background:#f9f9f9;text-align:left;}
.number{text-align:right;}
.positive{color:#4CAF50;font-weight:bold;}
.negative{color:#F44336;font-weight:bold;}
.spacer{height:20px;}
</style></head><body>
<h1>${docTitle}</h1>
<h2>グラフ</h2><div class="spacer"></div>
<h2>表</h2>
<table><thead><tr><th></th><th>n8n</th><th>Dify</th></tr></thead><tbody>
<tr><td>今月</td><td class="number">${formatNumber(n8nThisMonth)}</td><td class="number">${formatNumber(difyThisMonth)}</td></tr>
<tr><td>先月</td><td class="number">${formatNumber(n8nLastMonth)}</td><td class="number">${formatNumber(difyLastMonth)}</td></tr>
<tr><td>差分</td>
  <td class="number ${n8nDiff>=0?'positive':'negative'}">${formatDiff(n8nDiff)}</td>
  <td class="number ${difyDiff>=0?'positive':'negative'}">${formatDiff(difyDiff)}</td></tr>
</tbody></table>
<h2>コメント</h2><div class="spacer"></div>
<h2>ニュース</h2></body></html>`;

// ------------ Google Drive 用 multipart 本文 ------------
const boundary = 'divider';
const CRLF     = '\r\n';

const metadata = JSON.stringify({
  name    : docName,
  mimeType: 'application/vnd.google-apps.document',
  parents : [folderId], // 動的に取得したフォルダIDを使用
});

// マルチパート組み立て（CRLF を実文字）
let body  = `--${boundary}${CRLF}`;
body     += `Content-Type: application/json; charset=UTF-8${CRLF}${CRLF}`;
body     += `${metadata}${CRLF}`;
body     += `--${boundary}${CRLF}`;
body     += `Content-Type: text/html${CRLF}${CRLF}`;
body     += `${htmlDocument}${CRLF}`;
body     += `--${boundary}--${CRLF}`;   // ← 終端境界

return {
  rawData     : body,
  documentName: docName,
  titleDate   : titleDate,
  folderId    : folderId,
  debugInfo   : {
    n8nThisMonth, difyThisMonth, n8nDiff, difyDiff,
    bodyLength : body.length,
    boundaryOK : body.includes(`--${boundary}--${CRLF}`),
    folderInfo : folderData
  },
};

const today = new Date();

// 先月末の日付を計算（今月の1日から1日引く）
const lastMonthEnd = new Date(today.getFullYear(), today.getMonth(), 0);

// 先々月末の日付を計算（先月の1日から1日引く）
const twoMonthsAgoEnd = new Date(today.getFullYear(), today.getMonth() - 1, 0);

// フォーマット関数（元のコードと同じ形式）
function formatDate(date) {
  const day = String(date.getDate()).padStart(2, '0');
  const month = String(date.getMonth() + 1).padStart(2, '0'); // 月は0から始まるため+1
  const year = date.getFullYear();
  return `${day}-${month}-${year}`;
}

return {
  lastMonthEnd: formatDate(lastMonthEnd),
  twoMonthsAgoEnd: formatDate(twoMonthsAgoEnd)
};

// Google Documentの出力データを取得
const documentData = $input.all()[0].json;
const content = documentData.body.content;

// 「グラフ」見出しの要素インデックスを検索
let elementIndex = null;

for (let i = 0; i < content.length; i++) {
  const element = content[i];

  // paragraph要素をチェック
  if (element.paragraph && element.paragraph.elements) {
    for (let j = 0; j < element.paragraph.elements.length; j++) {
      const textElement = element.paragraph.elements[j];

      // textRunの内容が「グラフ」を含むかチェック
      if (textElement.textRun && textElement.textRun.content.includes('グラフ')) {
        elementIndex = i + 1; // 見出しの次の位置に挿入
        break;
      }
    }
  }

  if (elementIndex !== null) break;
}

// 結果を返す
return [{
  json: {
    commentEndIndex: elementIndex || content.length, // 見つからない場合は最後に挿入
    message: elementIndex ? `グラフ挿入位置: ${elementIndex}` : '最後に挿入されます'
  }
}];

