// Google Documentの出力データを取得
const documentData = $input.all()[0].json;
const content = documentData.body.content;

// 「コメント」見出しを検索
let commentStartIndex = null;

for (let i = 0; i < content.length; i++) {
  const element = content[i];

  // paragraph要素で見出しスタイルを持つものをチェック
  if (element.paragraph && element.paragraph.elements) {
    for (let j = 0; j < element.paragraph.elements.length; j++) {
      const textElement = element.paragraph.elements[j];

      if (textElement.textRun && textElement.textRun.content.includes('コメント')) {
        commentStartIndex = element.endIndex;
        break;
      }
    }
  }

  if (commentStartIndex !== null) break;
}

// コメント見出しの次の段落を検索
let commentText = '';

if (commentStartIndex !== null) {
  for (let i = 0; i < content.length; i++) {
    const element = content[i];

    if (element.startIndex === commentStartIndex && element.paragraph) {
      // テキスト内容を抽出
      if (element.paragraph.elements) {
        for (let j = 0; j < element.paragraph.elements.length; j++) {
          const textElement = element.paragraph.elements[j];
          if (textElement.textRun && textElement.textRun.content) {
            commentText += textElement.textRun.content;
          }
        }
      }
      break;
    }
  }
}

// 結果を返す
return [{
  json: {
    commentText: commentText.trim(),
    commentStartIndex: commentStartIndex
  }
}];

