  // paragraph要素をチェック
  if (element.paragraph && element.paragraph.elements) {
    for (let j = 0; j < element.paragraph.elements.length; j++) {
      const textElement = element.paragraph.elements[j];

      // textRunの内容が「コメント」を含むかチェック
      if (textElement.textRun && textElement.textRun.content.includes('コメント')) {
        commentEndIndex = element.endIndex;
        break;
      }
    }
  }

  if (commentEndIndex !== null) break;
}

